import React , {Component} from 'react'
import './Header.css'
export default class Header extends Component{
    render(){
        return(
            <div className="Header">
                <header>
                    <div class="topnav">
                        <h1 style="color:aquamarine; margin-left: 25px;">Blog Website</h1>
                        <a href="#" style="float:right">HELP</a>
                    </div>
                </header>
            </div>
        )
    }
}
